Information
------------------------------

Robson's Extreme Fishing Challenge series 5
Robson Green has fished the world, learning from some of the planet's greatest fishermen along the way. Now it's time for him to put his skills to the ultimate test. Doing battle with more than just fish, it's Robson vs. The Americas in Robson's Extreme Fishing Challenge.
This fifth series of Extreme Fishing sees Robson Green pitching himself against fishing champions in an epic journey spanning North and South America. Amongst the many challenges facing him, Robson has to master the technique of fishing with a bow and arrow on the Great Lakes of North America, reel in a rather haunting species of fish in the depths of the Amazon River and tackle high-altitude angling in Peru.
With the stakes higher than ever, will Robson sink or swim?


1)  Brazil 
For the first challenge of the series, Robson travels to the land of sand, samba and soccer to fish against Brazil's finest along both the 5000 miles of Atlantic shoreline, and the mighty Amazon River system. Can this Englishman gain revenge for countless years of world cup defeats?

2)  The Great Lakes 
Robson heads to the largest expanse of freshwater on earth: the Great Lakes of North America. Here, he competes against some of the best anglers the lakes have to offer, chasing everything from Muskie, or Water Wolf, to Lake Sturgeon.

3)  Mexico 
This week Robson travels to the biggest Spanish speaking country in the world to hunt a wealth of different salt-water targets on both the Pacific and Caribbean coasts. First stop is the Marlin capital of the Pacific - Cabo San Lucas - and a match-up with a trophy winning Marlin hunter.

4)  Canada 
First the stunning Fraser River Canyon in search of the White Sturgeon, the biggest freshwater fish in North America. Can Robson out-compete his uber-opponent: a super competitive pro-Ice Hockey player?

5)  Texas 
This week Robson is Texas, the Lone Star State. Starting on the Trinity River, Robson is chasing a monster: Alligator Gar. The second biggest freshwater fish in North America, it's one of the most ferocious looking predators Robson's ever seen.

6)  USA East Coast 
This week Robson's fishing challenge takes him to New York where his opponent is a cigar chomping Italian American known as the Tony Soprano of fishing. Under the Statue of Liberty they chase Bluefin Tuna - who will end up sleeping with the fishes in this one?

7)  Peru 
Robson's next stop is Peru, where he will fish the world's largest river, its largest ocean, and one of its highest mountain ranges. He starts with a breathtaking 4000 metre ascent into the Andes to fish for trout.

8)  Alaska 
The final challenge of Robson's Americas' tour is Alaska - The Final Frontier. Robson makes Salmon his first target in a high-octane fishing battle against an ex-Marine and gun seller. Can the plucky Brit stand up to an angling assault against fishing's equivalent of the Sherman Tank?

